import React from "react";
import { ReactFlowProvider, ReactFlow, Background } from "reactflow";
import "reactflow/dist/style.css";

export default function SkeletonGraphPlaceholder() {
  // Create dummy nodes
  const nodes = Array.from({ length: 8 }, (_, i) => ({
    id: `skeleton-node-${i}`,
    data: { label: "" },
    position: { x: 50 + (i % 4) * 200, y: 50 + Math.floor(i / 4) * 150 },
    style: {
      width: 120,
      height: 60,
      background: "rgba(200,200,200,0.2)", // faint grey
      border: "1px solid rgba(200,200,200,0.3)",
      borderRadius: 8,
    },
    selectable: false,
    draggable: false,
  }));

  // Create dummy edges connecting nodes
  const edges = [
    { id: "e0-1", source: "skeleton-node-0", target: "skeleton-node-1", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e1-2", source: "skeleton-node-1", target: "skeleton-node-2", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e2-3", source: "skeleton-node-2", target: "skeleton-node-3", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e0-4", source: "skeleton-node-0", target: "skeleton-node-4", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e4-5", source: "skeleton-node-4", target: "skeleton-node-5", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e5-6", source: "skeleton-node-5", target: "skeleton-node-6", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
    { id: "e6-7", source: "skeleton-node-6", target: "skeleton-node-7", animated: false, style: { stroke: "rgba(200,200,200,0.2)", strokeWidth: 2 } },
  ];

  return (
    <div style={{ width: "100%", height: "81vh", background: "#f9f9f9" }}>
      <ReactFlowProvider>
        <ReactFlow nodes={nodes} edges={edges} nodesDraggable={false} fitView>
          <Background color="rgba(200,200,200,0.1)" gap={16} />
        </ReactFlow>
      </ReactFlowProvider>
    </div>
  );
}
